import React from 'react';
import { Link, useHistory } from 'react-router-dom';
import {NewPost} from './'

const Profile= ({userData, token, posts})=>{

    const newPost = ()=>{
        const history = useHistory();
        history.push('dashboard/newPost')
    }

    return (
        <>
        <div>
        {userData.username && <div>Hello, {userData.username}!</div>}
        </div>
        <Link to='dashboard/newPost'>Create new listing</Link>
        <Link to='dashboard/messages'>Inbox</Link>

        </>
    )

}

export default Profile;
